import React from "react";

const ArrowDownIcon = () => {
  return (
    <>
      <svg
        width="14"
        height="9"
        viewBox="0 0 14 9"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
        className="ease-in-out text-current stroke-current"
      >
        <path d="M1 1L7 7L13 1" stroke-width="1.5" stroke-linecap="round" />
      </svg>
    </>
  );
};

export default ArrowDownIcon;
